import React from "react";
import Cart from "./Cart";
import Header from "./../../components/Header";
import Footer from "../../components/Footer";
const MainCart = (products) => {
  return (
    <section>
      <Header />
      {products.map()}
      <Footer />
    </section>
  );
};

export default MainCart;
